@Override
    public boolean equals(Object obj) {
        if (obj == this) {
            return true;
        }
        if (obj instanceof Fraction == false) {
            return false;
        }
        Fraction other = (Fraction) obj;
        return (getNumerator() == other.getNumerator() &&
                getDenominator() == other.getDenominator());
    }
